import React from "react";
import styled from "styled-components";

const Main = styled.div`
  width: 100%;
  height: 70vh;
  margin: 10vh 0;
  align-itens: center;

`;

const PhotoDiv = styled.div`
  width: 50%;
  height: 100%;
  background: aqua;
`;

export default function index() {
    return (
        <Main>
          <PhotoDiv></PhotoDiv>
        </Main>
    );
}
